import {
    UPDATE_WALLET_LIST

} from '../actions'

const init_state = {
    wallet: [
        {
            small_name_slug: "XEM",
            balance: 20.3654
        }
    ]
}
export const wallet = (state=init_state, action)=>{
    switch (action.type) {
        case UPDATE_WALLET_LIST:
            return {
                ...state,
                wallet: action.payload
            };

        default:
            return state;
    }
}
